 (props) => {
  //console.log({ value, extraOptions: extra.options });
  const { value, extra, onChange, className } = props;
  return (
    <Select
      autoSuggest={extra.autoSuggest}
      // containerClassName={UI.input}
      className={className || UI.selectInput}
      title={extra.title || ""}
      options={extra.options}
      value={value}
      onChange={(value) => {
        if (value) {
          onChange(value);
        }
      }}
    />
  );
}
